import React from 'react'
import Card from '../component/Card'
export default class CardContainer extends React.Component{

    generateCards(){
        let i = 0
        while(i < 26){
            return <Card word = {this.props.cards[i]}/>
            i++
        }
    }
    render(){

        return (
            <div>
            {this.generateCards()}
            </div>
        )
    }
}
